    requiereNit() {
        return (control) => {
            const anio = control.get('fechaNacimiento').get('anio').value;
            const mes = control.get('fechaNacimiento').get('mes').value;
            const dia = control.get('fechaNacimiento').get('dia').value;
            if (anio.length < 4) {
                return {
                    invalitYear: true
                };
            }
            const nit = `${dia}${mes}${anio.substring(2, 4)}`;
            const regex = new RegExp(`^[0-9]{4}${nit}.*$`, 'm');
            if (!regex.test(control.get('nit').value)) {
                return {
                    invalitNit: true
                };
            }
            return null;
        };
    }
